import React from 'react'

function header() {
    return (
        <div className='header'>
            <h1 className='pageTitle'> Brenda's Movie Collection</h1>
            <img className='logo' src='https://images.unsplash.com/photo-1542204165-65bf26472b9b?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=967&q=80' alt='logo' />
        </div>
    )
}

export default header
